import React,{useMemo} from 'react'
import {usetable} from 'react-table'
import MOCK_DATA from './MOCK_DATA.csv'
import { COLOUMNS } from './Coloumns'

function BasicTable() {

    const coloumns=useMemo(()=>COLOUMNS,[])
    const data=useMemo(()=>MOCK_DATA,[])

   const tableInstance = usetable({
        coloumns,
        data,
    })

    const{
        getTableProps,
        getTableBodyProps,
        headerGroups,
        rows,
        prepareRows,
    }=tableInstance

  return (
   <table{...getTableProps}>
     <thead>
         {headerGroups.map((headerGroups)=>(
            <tr {...headerGroups.getHeaderGroupProps()}>
                {headerGroups.headers.map((coloumn)=>(
                    <th {...coloumn.getheaderProps()}>{coloumn.render('Header')}</th> 
                ))}
           </tr>
         ))}
     </thead>
     <tbody{...getTableBodyProps()}>
     {rows.map((row)=>{
        prepareRows(row)
        return(
            <tr {...row.getroeProps()}>
            {row.cells.map((cell)=>{
                return  <td {...cell.getCellProps()}>{cell.render('cell')}</td>
            })}
         </tr>
        )})}

     </tbody>
   </table>
  )
}

export default BasicTable
